import React from "react";
import { useHistory } from "react-router-dom";

const Account = () => {
  let history = useHistory();
  const token = localStorage.getItem("token");
  if (token == null) {
    history.push({
      pathname: "/signin",
    });
  }

  return (
    <div className="account">
      <h1>Account</h1>
    </div>
  );
};

export default Account;
